import React from 'react'
import {
    Grid, 
    Card, 
    Select,
    FormControl,
    InputLabel }from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

const useStyles = makeStyles((theme) => ({
    LeftBar:{
        background:"#201B20",
        height:"100vh"
    },
    Heading:{
        fontFamily:"roboto",
        fontSize: 18,
        fontWeight: 400,
        letterSpacing:" 0em",
        color:"#F9F3FA"
    },
    select: {
        maxWidth: 100,
        fontSize:"0.9rem",
        background: 'white',
        color: "black",
        borderStyle:'none',
        borderWidth: 2,
        borderRadius: 4,
        margin:"0px 10px",
        paddingLeft: 24,
        paddingTop: 12,
        paddingBottom: 13,
        boxShadow: '0px 5px 8px -3px rgba(0,0,0,0.14)',
        "&:focus":{
          borderRadius: 4,
          background: 'white',
        },
      },
      icon:{
        right: 12,
        position: 'absolute',
        userSelect: 'none',
        pointerEvents: 'none'
      },
  }));
export default function Filter() {
    const classes = useStyles();

    const iconComponent = (props) => {
        return (
            <ExpandMoreIcon className={props.className + " " + classes.icon}/>
            )};


    return (
        <div>
            <Card className={classes.LeftBar}>
                <div className={classes.text}>
                    <h2 className={classes.Heading}>Find a rental property</h2>
                    <FormControl >
                    <InputLabel id="demo-mutiple-chip-label" className={classes.labelText}>County</InputLabel>
                        <Select
                            SelectDisplayProps={{ style: { minWidth: 100 } }}
                            id="demo-mutiple-chip"
                            // value={context.CountyFilterList }
                            // onChange={handleChangeCounty}
                            classes={{ root: classes.select }}
                            disableUnderline
                            IconComponent={iconComponent}
                            >
                            <MenuItem  value="All"  >
                            All
                            </MenuItem>
                            {/* {CountyData.map((name, i) => (
                                <MenuItem key={i} value={name} >
                                {name}
                                </MenuItem>
                            ))} */}
                        </Select>
                    </FormControl>
                </div>
            </Card>
        </div>
    )
}
